#!/usr/bin/env python3
"""Scrape BigBeluga scripts from TradingView."""
import asyncio
import json
from playwright.async_api import async_playwright

async def scrape_scripts():
    async with async_playwright() as p:
        browser = await p.chromium.launch(headless=True)
        page = await browser.new_page()

        print("Loading BigBeluga scripts page...", flush=True)
        await page.goto("https://www.tradingview.com/u/BigBeluga/#published-scripts", wait_until="networkidle", timeout=60000)
        await page.wait_for_timeout(3000)

        # Scroll to load all scripts
        for i in range(10):
            await page.evaluate("window.scrollTo(0, document.body.scrollHeight)")
            await page.wait_for_timeout(1000)
            print(f"Scroll {i+1}/10", flush=True)

        # Extract script info
        scripts = await page.evaluate('''
            () => {
                const items = document.querySelectorAll('[class*="card"], [class*="script"], [class*="publication"]');
                const results = [];

                items.forEach(item => {
                    const titleEl = item.querySelector('a[href*="/script/"], [class*="title"]');
                    const descEl = item.querySelector('[class*="description"], [class*="text"]');

                    if (titleEl) {
                        results.push({
                            title: titleEl.textContent?.trim() || '',
                            link: titleEl.href || '',
                            desc: descEl?.textContent?.trim()?.substring(0, 200) || ''
                        });
                    }
                });

                // Also try alternate selectors
                document.querySelectorAll('a[href*="/script/"]').forEach(a => {
                    const title = a.textContent?.trim();
                    if (title && title.length > 3 && !results.find(r => r.title === title)) {
                        results.push({
                            title: title,
                            link: a.href || '',
                            desc: ''
                        });
                    }
                });

                return results;
            }
        ''')

        await browser.close()
        return scripts

scripts = asyncio.run(scrape_scripts())
print(json.dumps(scripts, indent=2))
